Object.Field:
DECLARE
contEstatus NUMBER;
nuevoEstatus VARCHAR2(255);

BEGIN
  SELECT COUNT(1) into contEstatus 
  FROM stg.ban_config_stg_date bcsd, stg.ban_config_stg bcs
  where bcsd.cds_status_carga = 'ERROR'
  and bcs.cos_source = '#SIG.vStgNombreTablaStg'
  and bcs.cos_source = bcsd.cds_source
  and bcsd.CDS_SESSION_PROCCES = <?=snpRef.getSession("SESS_NO") ?>
  and (bcsd.cds_date between bcs.cos_start_date and bcs.cos_end_date);

  IF (contEstatus = 0) THEN
    SELECT COUNT(1) into contEstatus
    FROM stg.ban_config_stg_date bcsd, stg.ban_config_stg bcs
    where bcsd.cds_status_carga = 'CONTINGENCIA'
    and bcs.cos_source = '#SIG.vStgNombreTablaStg'
    and bcs.cos_source = bcsd.cds_source
    and bcsd.CDS_SESSION_PROCCES = <?=snpRef.getSession("SESS_NO") ?>
    and (bcsd.cds_date between bcs.cos_start_date and bcs.cos_end_date);

    if (contEstatus = 0) THEN
       nuevoEstatus := 'PROCESADO';
    else
      nuevoEstatus := 'CONTINGENCIA';
    END IF;

  else
   nuevoEstatus := 'ERROR';

  END IF;

SELECT COUNT(1) into contEstatus 
  FROM stg.ban_config_stg_date bcsd, stg.ban_config_stg bcs
  where bcs.cos_source = '#SIG.vStgNombreTablaStg'
  and bcs.cos_source = bcsd.cds_source
  and bcsd.CDS_SESSION_PROCCES = <?=snpRef.getSession("SESS_NO") ?>;

UPDATE stg.BAN_CONFIG_STG
SET COS_STATUS_CARGA = nuevoEstatus
WHERE COS_SOURCE = '#SIG.vStgNombreTablaStg' AND contEstatus !=0;

END;

